import axios from 'axios';
import React, { useEffect } from 'react'
// import './main.css';

function App() {
  // useEffect(()=>{
  //   async function getdata(){
  //     const res = await axios.get('https://movie-database-imdb-alternative.p.rapidapi.com/');
  //     console.log(res);
  //   }
  //   getdata();
  // })
  var axios = require("axios").default;

var options = {
  method: 'GET',
  url: 'https://movie-database-imdb-alternative.p.rapidapi.com/',
  params: {i: 'tt4154796', r: 'json'},
  headers: {
    'x-rapidapi-key': '89e9e26e85msh76ac1f24caff92cp1c5c1djsne1af44c26e6c',
    'x-rapidapi-host': 'movie-database-imdb-alternative.p.rapidapi.com'
  }
};

axios.request(options).then(function (response) {
	console.log(response.data);
}).catch(function (error) {
	console.error(error);
});
  return (
    <h1>Hello I am Harsh Bhatnagar</h1>
  );
}

export default App;
